import React from 'react';

class App extends React.Component {
  render() {
    return (
      <div>
        <h1 className="header"> Hello, I'm Mr. Cash. </h1>
        <h2 className="header2"> I'll buy your stuff for CASH! It's never been easier to get cash for you unwanted stuff. I'll buy anything you have  </h2>
        <button className="home-button"> GET OFFER </button>
      </div>
    )
  }
}

export default App;
